import React, { Component } from 'react';

import './App.css';

class App extends Component{
  constructor(props){
    super(props)
    this.state = {
      val:"hello"
    }
  } 

  render(){
    return(

    <h1>{this.state.val}</h1>
    )
  }

}

export default App;
